import Dice from './dice'

function Row({row, cols}){
    console.log('printing row number {$row}')
    let content = []
    for (let c = 1; c <= cols; c++){
        content.push(<td><Dice row={row} col={c}/></td> )
       }

    return content
}

export default Row
